--
-- HKStatisticsOptionNone
--
-- HKStatisticsOptionSeparateBySource
--
-- HKStatisticsOptionDiscreteAverage      Calculate averageQuantity when creating statistics.
--
-- HKStatisticsOptionDiscreteMin          Calculate minQuantity when creating statistics.
--
-- HKStatisticsOptionDiscreteMax          Calculate maxQuantity when creating statistics.
--
-- HKStatisticsOptionCumulativeSum        Calculate sumQuantity when creating statistics.
